import styled from "styled-components";

const MyPageHeader = styled.h1`
  font-size: 5rem;
  font-weight: 600;
`;

function MyPage() {
  return (
    <div id="GlobalContainer">
      <MyPageHeader></MyPageHeader>
    </div>
  );
}

export default MyPage;
